TourplanServiceLineControl.prototype.Validate = function() {
	var control = this;

	var paxNames = [];

	var valid = true;
	_.forEach($(this.view).find('.required'), function(element) {
		var childrenValid = true;
		_.forEach($(element).find('select,input'), function(subElement) {
			if (_.isEmpty($(subElement).val())) {
				childrenValid = false;
			}
		})
		if (!childrenValid) {
			valid = false;
			$(element).addClass('has-error');
			$(element).closest('.collapse').addClass('in');
		} else {
			$(element).removeClass('has-error');
		}
	});

	var serviceDate = moment(this.serviceline.date, TourplanRetailUtilities.DATEFORMATS.DATA);

	_.forEach($(this.view).find(".passenger"), function(passenger, index) {

		$(passenger).removeClass("duplicate");

		paxNames.push({
			firstname: $(passenger).find("input[name=firstname]").val(),
			lastname: $(passenger).find("input[name=lastname]").val(),
			title: $(passenger).find("select[name=title]").val()
		});

		if (_.has(control.serviceline, 'ageLimits')) {
			var dobElement = $(passenger).find("input[name=dob]");
			var dob = moment($(passenger).find("input[name=dob]").val(), TourplanRetailUtilities.DATEFORMATS.DATA);
			
			var paxtype = control.serviceline.configs[0].pax[index].paxtype;

			var minDate, maxDate;
			if(control.serviceline.servicetype === 'Rail' && getServiceButtonConfig(control.serviceline.servicetype, 'useDepartureDate') == "true") {
				var preference1 = moment(control.serviceline.preference1, TourplanRetailUtilities.DATEFORMATS.DATA);
				minDate = preference1.clone().subtract((control.serviceline.ageLimits[paxtype].max + 1), 'years').add(1, 'days');
				maxDate = preference1.clone().subtract(control.serviceline.ageLimits[paxtype].min, 'years');
			}
			else {
				minDate = serviceDate.clone().subtract((control.serviceline.ageLimits[paxtype].max + 1), 'years').add(1, 'days');
				maxDate = serviceDate.clone().subtract(control.serviceline.ageLimits[paxtype].min, 'years');
			}
	
			if (!dob.isBetween(minDate, maxDate, null, '[]') || _.isEmpty(dobElement.val())) {
				$(dobElement).closest('.required').addClass('has-error');
				valid = false;
			}
			else {
				$(dobElement).closest('.required').removeClass('has-error');
			}
		}
	});

	var pref1Element = $(this.view).find("input[name=preference1]");
	var pref1 = moment($(pref1Element).val(), TourplanRetailUtilities.DATEFORMATS.DATA);

	if (pref1Element.length > 0 && (!pref1.isValid() || !pref1.isBetween(this.minMaxPref1DateObj.minDate.clone().subtract(1, 'days'), this.minMaxPref1DateObj.maxDate, null, '[]'))) {
		$(pref1Element).closest('.required').addClass('has-error');
		valid = false;
	} else {
		$(pref1Element).closest('.required').removeClass('has-error');
	}

	/// Check for duplicate name
	console.log(paxNames);
	var uniquePax = _.uniq(paxNames, function(p) { return JSON.stringify([p.firstname.toUpperCase(), p.lastname.toUpperCase(), p.title.toUpperCase()])});
	var duplicatePax = _.difference(paxNames, uniquePax);
	valid = valid && _.isEmpty(duplicatePax);

	if (!_.isEmpty(duplicatePax)) {
		var duplicatePaxElements = [];
		_.forEach(duplicatePax, function(dp, idx) {

			duplicatePaxElements.push($(control.view).find(".passenger").filter(function(idx, p) {
				return $(p).find("select[name=title]").val().toUpperCase() == dp.title.toUpperCase()
						&& $(p).find("input[name=firstname]").val().toUpperCase() == dp.firstname.toUpperCase()
						&& $(p).find("input[name=lastname]").val().toUpperCase() == dp.lastname.toUpperCase()
			}));
		});

		_.forEach(duplicatePaxElements, function(el) {
			$(el).addClass("duplicate");
		});

		alert(getServiceButtonConfig("", "duplicatePaxLabel", "Each passenger can only be entered once."));

	}

	return valid;
}

