TourplanAmenityFilter = function(element, amenityCategory) {
	this.element = element;
	this.allLookups = _.map(
		TourplanRetailUtilities.GetLookupMap("AMCAMN","AMN", ["AMC=" + amenityCategory])[0].codes,
		function(code) {
			return _.find(window.tpSearchParams.lookups, function(lookup) { return lookup.code == code; });
		}
	);


	if (TourplanRetailUtilities.DesktopDevice()) {
		$(this.element).multiselect();
	}
}

TourplanAmenityFilter.prototype.SetOptions = function(possibleCodes) {
	var toDisplay = _.filter(this.allLookups, function(lookup) {
		return _.find(possibleCodes, function(code) { return lookup.code == code; });
	});

	$(this.element).empty();

	$(this.element).html(TourplanRetailUtilities.GenerateOptionsString(_.map(
		toDisplay, 
		function(map) { 
			return {label:map.name, value:map.code}
		}
	)));

	if (TourplanRetailUtilities.DesktopDevice()) {
		$(this.element).multiselect('destroy').multiselect();
	}
}

TourplanAmenityFilter.prototype.GetSelected = function() {
	return $(this.element).val() ? $(this.element).val().join(',') : null;
}

TourplanAmenityFilter.prototype.SetSelected = function(selected) {
	$(this.element).val(selected);

	if (TourplanRetailUtilities.DesktopDevice()) {
		$(this.element).multiselect('destroy').multiselect();
	}
}

TourplanProductSearchControl = function(rootElement, searchConfigs) {
	var searchControl = this;
	this.urlSearchParams = [];
	_.extend(this, new TourplanCommonControl(rootElement, searchConfigs, null));
	
	this.urlSearchParams = TourplanRetailUtilities.DeserializeURLParameters(window.location.search[0] == "?" ? window.location.search.substr(1) : window.location.search);
	this.pageSearchParams = searchConfigs.search_config;

	console.log(this);

	$(this.pluginControl).html(this.templates.masterTemplate());
	$(this.pluginControl).find('.productSearchSection').html(this.templates.productSearchTemplate(this.searchConfigs));

	this.inputs = {};

	_.forEach($(this.rootElement).find('input,select'), function(el) {
		if (!_.isEmpty(el.name)) {
			searchControl.inputs[el.name] = $(el);
		}
	});

	this.amenityFilters = _.map($(this.pluginControl).find('.amenity-filter'), function(x) {
		return new TourplanAmenityFilter(x, x.name);
	});

	console.log(this.amenityFilters);


	this.inputs.srb.val(this.GetSearchParam('srb').value);
	this.inputs.cty.val(this.GetSearchParam('cty').value);

	if (this.inputs.cty && this.inputs.cty.is('select')) {
		var srb = this.inputs.srb.val();

		var mappings = TourplanRetailUtilities.GetLookupMap("SRBCTY", "CTY", ['SRB=' + srb])[0];

		this.inputs.cty.empty();

		this.inputs.cty.html(
			TourplanRetailUtilities.GenerateOptionsString(
				_.map(mappings.codes, function(code) {
					return { label:code, value:code };
				}),
				true
			)
		);

		this.inputs.cty.val(this.GetSearchParam('cty').value);
	}

	if (this.inputs.dst && this.inputs.dst.is('select')) {
		var srb = this.inputs.srb.val();
		var cty = this.inputs.cty.val();

		var mappings = TourplanRetailUtilities.GetLookupMap("SRBCTYDST", "DST", ['SRB=' + srb, 'CTY=' + cty])[0];
		
		this.inputs.dst.empty();

		this.inputs.dst.html(
			TourplanRetailUtilities.GenerateOptionsString(
				_.map(mappings.codes, function(code) {
					return {label:code, value:code};
				}),
				false
			)
		);

		this.inputs.dst.val(this.GetSearchParam('dst').value);

		var amnMappings = TourplanRetailUtilities.GetLookupMap("SRBDSTAMN", "AMN", ["SRB=" + srb, "DST=" + this.inputs.dst.val()])[0];

		_.forEach(searchControl.amenityFilters, function(filter) {
			filter.SetOptions(amnMappings.codes);
			if (searchControl.GetSearchParam('amn')) {
				filter.SetSelected(searchControl.GetSearchParam('amn').value.split(','));
			}
		});

		this.inputs.dst.change(function() {
			var srb = searchControl.inputs.srb.val();
			var dst = searchControl.inputs.dst.val();

			if (searchControl.inputs.lcl) {

				var lclMappings = TourplanRetailUtilities.GetLookupMap("SRBDSTLCL", "LCL", ['SRB=' + srb, 'DST=' + dst])[0];

				searchControl.inputs.lcl.empty();
				searchControl.inputs.lcl.html(
					TourplanRetailUtilities.GenerateOptionsString(
						_.map(lclMappings.codes, function(code) {
							return {label:code, value:code};
						}),
						true
					)
				);
			}

			var amnMappings = TourplanRetailUtilities.GetLookupMap("SRBDSTAMN", "AMN", ["SRB=" + srb, "DST=" + dst])[0];

			_.forEach(searchControl.amenityFilters, function(filter) {
				filter.SetOptions(amnMappings.codes);
			});
		});
	}

	if (this.inputs.lcl && this.inputs.lcl.is('select')) {
		var srb = this.inputs.srb.val();
		var dst = this.inputs.dst.val();

		var mappings = TourplanRetailUtilities.GetLookupMap("SRBDSTLCL", "LCL", ['SRB=' + srb, 'DST=' + dst])[0];

		this.inputs.lcl.empty();

		this.inputs.lcl.html(
			TourplanRetailUtilities.GenerateOptionsString(
				_.map(mappings.codes, function(code) {
					return {label:code, value:code};
				}),
				true
			)
		);


		if (this.GetSearchParam('lcl').value) {
			this.inputs.lcl.val(this.GetSearchParam('lcl').value);
		}
		else {
			this.inputs.lcl[0].selectedIndex = 0;
		}
	}

	var searchDateUrlParam = _.find(this.urlSearchParams, function(x) {
		return x.name == 'date';
	});

	if (this.searchConfigs.room_based) {
		var options = [];
		for (var i = 1; i <= 10; i++) {
			options.push({
				label: i,
				value: _.times(i, function(x) { return searchControl.searchConfigs.default_room_type; }).join(',')
			});
		}

		this.inputs.qty.html(TourplanRetailUtilities.GenerateOptionsString(options, false));

	}

	this.inputs.qty.val(this.GetSearchParam('qty').value);


	var scuParam = this.GetSearchParam('scu').value;
	var dateParam = this.GetSearchParam('date').value;

	this.dateControl = new TourplanDateControl(
		$(this.rootElement).find('.input-daterange'),
		$(this.rootElement).find('input[name=date]'),
		$(this.rootElement).find('input[name=toDate]'),
		$(this.rootElement).find('select[name=scu]'),
		{
			startDate: (dateParam ? moment(dateParam, 'YYYY-MM-DD') : new moment()),
			scu: scuParam ? scuParam : null,
			minLength: 1
		},
		this.searchConfigs.date_config
	);
	
	$(this.rootElement).find('button[name=search]').click(function(e) {
		if (searchControl.searchConfigs.quicksearch) {
			var searchString = _.map(searchControl.GetSearchParams(), function(x) { return x.name + '=' + x.value; }).join('&');
			window.location.href = searchControl.searchConfigs.results_page + "?" + searchString;
		} else {
			//execute search
			$(searchControl.rootElement).find('.resultsSection').html(TourplanRetailUtilities.loadingImage());
			$(searchControl.rootElement).find('.additionalResultsSection').html(TourplanRetailUtilities.loadingImage());
			REI.Availability(searchControl.GetSearchParams(), function(availData) {
				$(searchControl.rootElement).find('.resultsSection').empty()

				searchControl.results = [];

				if (searchControl.searchConfigs.supplier_level) {
					_.forEach(availData, function(supplier) {
						var supplier = new TourplanSupplier(supplier);
						console.log(supplier);
						searchControl.results.push({
							supplier:supplier.supplier,
							product:supplier.LowestPricedProduct(),
							availability:new TourplanAvailability(supplier.LowestPricedProduct().LowestPricedAvailability()),
							destinationUrl:searchControl.searchConfigs.product_info_page
						});
					})
				} 
				else {
					_.forEach(availData, function(supplier) {
						var supplier = new TourplanSupplier(supplier);
						_.forEach(supplier.products, function(product) {
							searchControl.results.push({
								supplier:supplier.supplier,
								product:product,
								availability:new TourplanAvailability(product.LowestPricedAvailability()),
								destinationUrl:searchControl.searchConfigs.product_info_page
							});
						});
					});
				}

				if (_.isEmpty(searchControl.results)) {
					$(searchControl.rootElement).find('.resultsSection').html(
						searchControl.templates.noResultTemplate(searchControl.searchConfigs));
				}
				else {
					// _.forEach(searchControl.results, function(result) {
					// 	$(searchControl.rootElement).find('.resultsSection').append(
					// 		searchControl.templates.resultTemplate(result)
					// 	)
					// });
					$(searchControl.rootElement).find('.resultsSection').append(
						searchControl.templates.resultTemplate({
							results:searchControl.results,
							searchConfigs:searchControl.searchConfigs
						})
					);

				}

				$('html, body').animate({
					scrollTop: $(searchControl.rootElement).find('.resultsSection').offset().top
				}, 1000);

				console.log(searchControl.results);

				if (searchControl.searchConfigs.date_range_config) {
					var searchParams = _.filter(searchControl.GetSearchParams(), function(x) {
						return x.name != 'date';
					});

					var searchDates = [];

					var days_before = parseInt(TourplanRetailUtilities.GetNameValuePair(searchControl.searchConfigs.date_range_config,'days_before').value);
					var days_after = parseInt(TourplanRetailUtilities.GetNameValuePair(searchControl.searchConfigs.date_range_config,'days_after').value);
					if (days_after > 0) {
						for (var i = 1; i <= days_after; i++) {
							searchDates.push(moment(searchControl.dateControl.GetFromDate()).add(i, 'days'));
						}
					}
					if (days_before > 0) {
						for (var i = 1; i <= days_before; i++) {
							searchDates.push(moment(searchControl.dateControl.GetFromDate()).subtract(i, 'days'));
						}
					}

					searchDates = _.map(searchDates, function(sd) {
						return _.clone(searchParams).concat([{name:'date',value:sd.format('YYYY-MM-DD')}]);
					});

					$.when.apply(
						$,
						_.map(searchDates, function(x) { return REI.Availability(x, null, null); })
					).done(function() {
						var additionalProducts = [];

						_.forEach(arguments, function(response) {

							if (searchControl.searchConfigs.supplier_level) {
								_.forEach(response[0], function(supplier) {
									var supplier = new TourplanSupplier(supplier);

									if (!_.find(additionalProducts, function(prod) {
										return prod.product.productid == product.productid;
									}) && !_.find(searchControl.results, function(prod) {
										return prod.product.productid == product.productid;
									})) {
										additionalProducts.push({
											supplier:supplier.supplier,
											product:supplier.LowestPricedProduct(),
											availability:new TourplanAvailability(supplier.LowestPricedProduct().LowestPricedAvailability()),
											destinationUrl:searchControl.searchConfigs.product_info_page
										});
									}
								});
							}
							else {
								_.forEach(response[0], function(supplier) {
									var supplier = new TourplanSupplier(supplier);

									_.forEach(supplier.products, function(product) {
										if (!_.find(additionalProducts, function(prod) {
											return prod.product.productid == product.productid;
										}) && !_.find(searchControl.results, function(prod) {
											return prod.product.productid == product.productid;
										})) 
										{
											additionalProducts.push({
												supplier:supplier.supplier,
												product:product,
												availability:new TourplanAvailability(product.LowestPricedAvailability()),
												destinationUrl:searchControl.searchConfigs.product_info_page
											});
										}
									});
								});
							}
						});

						$(searchControl.rootElement).find(".additionalResultsSection").empty();

						if (_.isEmpty(additionalProducts)) {
							$(searchControl.rootElement).find(".additionalResultsSection").html(
								searchControl.templates.noResultTemplate(searchControl.searchConfigs)
							);
						}
						else {
							// _.forEach(additionalProducts, function(x) {
							// 	$(".additionalResultsSection").append(searchControl.templates.resultTemplate(x));
							// });
							$(searchControl.rootElement).find(".additionalResultsSection").html(
								searchControl.templates.resultTemplate({
									results:additionalProducts,
									searchConfigs:searchControl.searchConfigs
								})
							);
						}
						console.log(additionalProducts);
					});
				}
			},
			function() {
				console.log(searchControl.searchConfigs);
				$(searchControl.rootElement).find('.resultsSection')
					.empty()
					.html(searchControl.templates.noResultTemplate(searchControl.searchConfigs));
			});

		}
	});

	if (!_.isEmpty(this.urlSearchParams) && !searchControl.searchConfigs.quicksearch) {
		$(this.rootElement).find('button[name=search]').click();
	}
}

TourplanProductSearchControl.prototype.GetSearchParams = function() {
	var productControl = this;
	var inputData = $(this.rootElement).find('input:not(.date),select:not(.amenity-filter)').serializeArray();
	inputData.push({name:'date', value:this.dateControl.GetFromDate()});
	inputData.push({name:'info', value:'roomtypes'});

	if (!_.isEmpty(this.amenityFilters)) {
		inputData.push({
			name:'amn', 
			value: _.filter(_.map(this.amenityFilters, 
					function(filter) { 
						return filter.GetSelected(); 
					}),
				function(x) { return !_.isEmpty(x); }).join(',')
		});
	}

	var required = ['scu','qty','date'];

	_.forEach(required, function(x) {
		if (!_.find(inputData, function(y) { return y.name == x; })) {
			inputData.push(productControl.GetSearchParam(x));
		}
	});

	inputData = _.filter(inputData, function(param) {
		return param.value != "All";
	});

	return inputData;
}

TourplanProductSearchControl.prototype.GetSearchParam = function(key) {
	var sources = [
		this.urlSearchParams,
		this.pageSearchParams
	];
	var sourceNum = 0;
	var param = false;

	while (_.isEmpty(param) && sourceNum < sources.length) {
		param = _. find(sources[sourceNum], function(p) {
			return p.name == key;
		});
		sourceNum += 1;
	}

	return param;
}

TourplanProductSearchControl.prototype.GetQty = function() {
	if (this.searchConfigs.room_based) {
		var roomList = [];
		for (var i = 0; i < this.inputs.qty.val(); i++) {
			roomList.push(this.searchConfigs.default_room_type);
		}
		return roomList.join(',');
	}
	else {
		return this.inputs.qty.val();
	}
}

TourplanProductController = function(productConfig) {
	this.controlConfig = {
		title: productConfig.title,
		paxType: productConfig.paxtype,
		defaultQty: productConfig.default_qty
	};
	this.qtyObj = {
		adult:0,
		child:0,
		infant:0
	}
	this.scu = getServiceButtonConfig(productConfig.service_button, "defaultScu", "1");
	this.productID = productConfig.productID;
	this.service_button = productConfig.service_button;
}

TourplanProductController.prototype.ProductRequest = function(overrides, updateProduct, successCallback, failureCallback) {
	var parentController = this;

	var searchData = {
		date: TourplanRetailUtilities.ValueOrDefault(overrides.date, this.GetDate()),
		scu: TourplanRetailUtilities.ValueOrDefault(overrides.scu, this.scu),
		qty: TourplanRetailUtilities.ValueOrDefault(overrides.qty, this.GetQty())
	}

	return REI.Product(this.productID, searchData, function(data) {
		if (data != null) {
			if (updateProduct) {
				parentController.data = new TourplanProduct(data.products[0]);
				parentController.supplier = new TourplanSupplier(data.supplier);
			}
			if (successCallback) {
				successCallback(data);
			}
		} else if (failureCallback) {
			failureCallback();
		}
	});
}

TourplanProductController.prototype.SetQty = function(qty) {
	$(this.view).find("select[name=" + this.controlConfig.paxType + "]").val(qty).change();
}

TourplanProductController.prototype.GetQty = function() {
	var qtyString = "";
	if (!_.isNull(this.qtyObj.adult)) {
		qtyString += this.qtyObj.adult + "A";
	}
	if (!_.isNull(this.qtyObj.child)) {
		qtyString += this.qtyObj.child + "C";
	}
	if (!_.isNull(this.qtyObj.infant)) {
		qtyString += this.qtyObj.infant + "I";
	}
	return qtyString;
}

TourplanProductController.prototype.GetDate = function() {
	return TourplanRetailUtilities.ValueOrDefault(
		$(this.view).find('.datepicker').val(),
		new moment().add(parseInt(getServiceButtonConfig(this.service_button, '0')), 'days').format(TourplanRetailUtilities.DATEFORMATS.DATA)
	);
}

TourplanProductController.prototype.Render = function(template) {
	return template(this);
}

TourplanProductController.prototype.UpdatePrice = function(newPrice) {
	this.price = newPrice;
	$(this.view).find('.priceElement').html(getServiceButtonConfig(this.service_button, "productPricePrefix") + (newPrice / 100).toFixed(2));
}

TourplanProductController.prototype.SetView = function(viewElement) {
	this.view = viewElement;
}

TourplanProductController.prototype.BuildServiceline = function() {

	var availability = this.data.LowestPricedAvailability();
	if (availability != Infinity) {
		var serviceline = new TourplanServiceLine({
			productid: this.data.productid,
			rateid: availability.RateId,
			date: availability.Date,
			scu: availability.Scu,
			price: availability.AgentPrice,
			qty: availability.Qty,
			availability: TourplanRetailUtilities.AvailabilityLookup(availability.Availability),
			productname: this.data.name,
			servicetype: this.data.srb,
			adultages: this.data.ageRanges.adultAgeRange,
			childages: this.data.ageRanges.childAgeRange,
			infantages: this.data.ageRanges.infantAgeRange,
			ageLimits: this.data.ageLimits,
			suppliercode: this.supplier.info.Supplier.SupplierCode,
			productcode: this.data.code
		});
		serviceline['configs'] = serviceline.BuildEmptyConfigs();
		return serviceline;
	} else {
		return false;
	}
}


TourplanMultiProductController = function(rootElement, controlConfiguration) {
	console.log(controlConfiguration);
	var parentControl = this;
	this.controlConfiguration = controlConfiguration;
	this.rootElement = rootElement;
	this.pluginControl = $(rootElement).find('.plugin_control').first();
	this.products = [];

	this.templates = {};


	_.forEach(
		$(this.rootElement).children('script[type="text/x-handlebars-template"]'), 
		function(x) {
			parentControl.templates[$(x).attr('class')] = Handlebars.compile($(x).html());
		}
	);

	this.pluginControl.html(this.templates.masterTemplate(controlConfiguration));

	var initialSearchDate = new moment().add(parseInt(getServiceButtonConfig(controlConfiguration.service_button, "searchDateOffset")), "days");
	var minDate = controlConfiguration.min_date_type == "fixed" ? 
		new moment(controlConfiguration.min_date_val, "DD/MM/YYYY") : 
		new moment().add(parseInt(controlConfiguration.min_date_val), "days");
	var maxDate = controlConfiguration.max_date_type == "fixed" ? 
		new moment(controlConfiguration.max_date_val, "DD/MM/YYYY") : 
		new moment().add(parseInt(controlConfiguration.max_date_val), "days");

	if (minDate.isAfter(initialSearchDate)) {
		initialSearchDate = minDate;
	}

	pikadayResponsive(
		$(this.rootElement).find(".datepicker"), 
		_.extend({},
			{
				minDate: minDate,
				maxDate: maxDate
			}, 
			TourplanRetailUtilities.PIKADAYDEFAULTS
		)
	).setDate(initialSearchDate);

	_.forEach(controlConfiguration.productConfs, function(productConf) {
		var productController = new TourplanProductController(_.extend(productConf, { 'service_button':parentControl.controlConfiguration.service_button }));
		var productView = $(productController.Render(parentControl.templates.productSearchTemplate)).appendTo(
			$(parentControl.rootElement).find('.productSearchSection')
		);
		productController.SetView(productView);


		_.forEach($(productView).find('select'), function(el) {
			$(el).change(function(e) {
				productController.qtyObj[$(e.target).attr('name')] = parseInt($(this).val());
				console.log(productController);
			});
		});

		productController.SetQty(productController.controlConfig.defaultQty);

		productController.ProductRequest({
			date: $(parentControl.rootElement).find(".datepicker").val(),
			qty: '1' + productController.controlConfig.paxType[0].toUpperCase()
		}, 
		true,
		function(data) {
			var product = new TourplanProduct(data.products[0]);

			if (product.LowestPricedAvailability().AgentPrice != null) {
				productController.UpdatePrice(product.LowestPricedAvailability().AgentPrice);
			}
			// var ageString = productController.data.ageRanges[productController.controlConfig.paxType + 'AgeRange'];
			// console.log(ageString);
			// $(productController.view).find(".controlTitle").html(
			// 	productController.controlConfig.title + " (" + ageString + ")"
			// );

		},
		function() {
			console.log("ERROR PRICING");
		});

		parentControl.products.push(productController);
	});

	$(this.rootElement).find('select, input').change(function() {
		$(parentControl.rootElement).find(".productInfoSection").slideUp();
	});

	$(this.rootElement).find('button[name=search]').click(function(e) {
		// $(parentControl.rootElement).mask("Please Wait");

		$(parentControl.rootElement).find('.productInfoSection').slideUp(400, function() {
			$(this).find(".productResultSection").empty();
			$(parentControl.rootElement).mask("");
		});

		var requestList = [];

		_.forEach(parentControl.products, function(productController) {
			var searchParams = { date: $(parentControl.rootElement).find('.datepicker').val() };
			requestList.push(productController.ProductRequest(searchParams, true));
		});

		$.when.apply($, requestList).done(function() {
			var totalPrice = 0;
			var atLeastOneResponse = false;
			if (requestList.length < 2) {
				arguments = [arguments];
			}
			_.forEach(arguments, function(response) {
				if (response[0] != null) {
					var product = new TourplanProduct(response[0].products[0]);

					if (product.LowestPricedAvailability() != Infinity) {
						totalPrice += product.LowestPricedAvailability().AgentPrice;
						atLeastOneResponse = true;
					}
				}

			});

			if (atLeastOneResponse) {


				console.log(totalPrice);

				$(parentControl.rootElement).find('.productInfoSection').html(parentControl.templates.productInfoTemplate(parentControl.controlConfiguration));

				$(parentControl.rootElement).find('button[name=book]').click(function(e) {
					$(parentControl.rootElement).mask("");
					var servicelines = [];

					_.forEach(parentControl.products, function(productController) {
						var serviceline = productController.BuildServiceline();

						if (serviceline) {
							servicelines.push(serviceline);
						}
					});


					CartInterface.GetCart(true, function() {
						CartInterface.cart.servicelines = CartInterface.cart.servicelines.concat(servicelines);

						CartInterface.PushCart({
							success: function() { 
								$(parentControl.rootElement).unmask();
								window.location = $("#tourplanRetailConfig").attr("itinerarypage"); 
							}
						});
					});

				});

				parentControl.UpdatePrice(totalPrice);

				_.forEach(parentControl.products, function(productController) {
					$(productController.Render(parentControl.templates.productResultTemplate)).appendTo(
						$(parentControl.rootElement).find('.productResultSection'));
				});

				$(parentControl.rootElement).find(".productResultsSection").slideDown();
			} else {
				$(parentControl.rootElement).find('.productInfoSection').html(parentControl.templates.noResultTemplate(parentControl.controlConfiguration));
			}


			$(parentControl.rootElement).find('.productInfoSection').slideDown(400, function() {
				$(parentControl.rootElement).unmask();
			});
		});
	});

	if (controlConfiguration.search_on_load) { 
		$(this.rootElement).find('button[name=search]').click();
	}
}

