TourplanCheckoutControl.prototype.Validate = function() {
	var valid = true;
	var emailRegex = /.+@.+/;
	var emailInput = $("input[name=email]");
	var emailConfirmInput = $("input[name=email_confirm]");

	var requiredNodes = $(this.rootElement).find('.customerSection .required');
	requiredNodes = requiredNodes.add($(this.rootElement).find('#tpcreditcardsection .required'));
	if (!$(this.rootElement).find('input[name=deliverySameAsCustomer]').is(':checked')) {
		requiredNodes = requiredNodes.add(".deliveryFeesSection .required");
	} else {
		_.forEach($(".deliveryFeesSection .required"), function(element) {
			$(element).removeClass('has-error');
		}); 
	}

	_.forEach(requiredNodes, function(element) {
		var childrenValid = true;
		_.forEach($(element).find('select,input'), function(subElement) {
			if (_.isEmpty($(subElement).val())) {
				childrenValid = false;
			};
		});
		if (!childrenValid) {
			valid = false;
			$(element).addClass('has-error');
		}
		else {
			$(element).removeClass('has-error');
		}
	});

	if ((emailInput.val() != emailConfirmInput.val()) || (!emailInput.val().match(emailRegex))) {
		valid = false;
		emailInput.closest('.required').addClass('has-error');
		emailConfirmInput.closest('.required').addClass('has-error');
	} else {
		emailInput.closest('.required').removeClass('has-error');
		emailConfirmInput.closest('.required').removeClass('has-error');
	}

	if (!_.isEmpty($(this.rootElement).find('input[name=confirm]'))) {
		if (!$(this.rootElement).find('input[name=confirm]').is(':checked')) {
			valid = false;
			$(this.rootElement).find('.confirmationSection').addClass('bg-danger');
		} else {
			$(this.rootElement).find('.confirmationSection').removeClass('bg-danger');
		}
	}


	return valid;
}


Handlebars.registerHelper('cleanCSSString', function(string) {
	return TourplanRetailUtilities.ToSafeCSSName(string);
});

Handlebars.registerHelper('repeatString', function(string, times, delimiter) {
	var tmp = [];
	for (var i = 0; i <= parseInt(times); i++) {
		tmp.push(string);
	}

	return tmp.join(delimiter);
})

Handlebars.registerHelper('forLoop', function(from, to, incr, options) {
	var fn = options.fn; inverse = options.inverse;
	var ret = '';
	for (var i = from; i < to; i += incr) {
		ret += fn(_.extend({}, {
			index: i, 
			indexPlusOne: i + 1,
			first: i == 0,
		}));
	}
	return ret;
});

Handlebars.registerHelper('paxConfigLoop', function(config, options) {
	var fn = options.fn; inverse = options.inverse;
	var ret = "";
	var tmp = [
		{ paxType:'A', paxTypeLong:'adult', count:config.adults },
		{ paxType: 'C', paxTypeLong:'child', count:config.children },
		{ paxType: 'I', paxTypeLong:'infant', count:config.infants }
	];

	var index = 0;
	for (var i = 0; i < tmp.length; i++) {
		for (var j = 0; j < tmp[i].count; j++) {
			ret += options.fn(_.extend(config, {
				index:index,
				paxNum:index + 1,
				paxNumOfType: j + 1,
				paxType: tmp[i].paxType,
				paxTypeLong:  tmp[i].paxTypeLong
			}));
			index += 1;
		}
	}

	console.log(this);
	return ret;
});

