Handlebars.registerHelper('roomTypeString', function(roomType) {

	var roomTypes = [
		{key:'sg',value:'Single'},
		{key:'db',value:'Double'},
		{key:'tw',value:'Twin'},
		{key:'tr',value:'Triple'},
		{key:'qd',value:'Quad'}
	];
	var roomCounts = [];
	_.forEach(roomTypes, function(rt) {
		var tmp = _.filter(roomType.split(','), function(x) { return x == rt.key; }).length;
		if (tmp > 0) { roomCounts.push(tmp + " " + rt.value); }
	});

	return roomCounts.join(',');
});

Handlebars.registerHelper('availabilityString', function(avail) {
	var availTypes = {
		'rq':'On Request',
		'ok':'Available'
	};
	return (availTypes[avail.toLowerCase()] ? availTypes[avail.toLowerCase()] : avail);
});

